         "<section id=\"feature\" class=\"slots\">\r\n<div class=\"bg-ultra-light-grey bg--white\">\r\n<article class=\"outer\">\r\n<article class=\"outer\">\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Estrutura fina com apenas 232 mm de profundidade</h3>\r\n</div>\r\n</div>\r\n<div class=\"grid-mix grid-1 grid--3 frame\">\r\n<div class=\"column column-main bg-white\">\r\n<p>A CASIO aplicou suas tecnologias de construção altamente compactas para atingir um tamanho ainda menor do que a série CDP anterior. Este piano compacto pode ser tocado em qualquer lugar, no seu próprio estilo.</p>\r\n</div>\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure\">\r\n<div class=\"txt-center\"><img alt=\"Estrutura fina com apenas 232 mm de profundidade\" src=\"https://www.casio-intl.com/media/br_pt/emi/images/cdp_s150/cdp_s150_img01.jpg\" /></div>\r\n</figure>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Nuances naturais de tom para produzir um som dinâmico do piano</h3>\r\n<p>Vem com 10 sons integrados de alta qualidade, incluindo piano de cauda. Você pode perceber sutis diferenças no tom ajustando a força com que as teclas são pressionadas.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Scaled Hammer Action Keyboard II</h3>\r\n<p>Para a nova série CDP-S, a Casio reduziu significativamente o tamanho do mecanismo de ação que simula o peso dos martelos em um piano de cauda. Isso permite um teclado com um toque sensível em um corpo incrivelmente fino.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Funciona via bateria</h3>\r\n<p>Além da energia elétrica doméstica, o CDP-S permite ser usado pela bateria, permitindo que os músicos toquem livremente em qualquer lugar.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Modo Dueto</h3>\r\n<p>As teclas à direita e à esquerda do centro no teclado podem ser configuradas na mesma faixa de tonalidade. Este Modo dueto é conveniente quando dois músicos, como pai e filho, ou professor e aluno, praticam juntos.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Gravador MIDI</h3>\r\n<p>Grave suas próprias apresentações na memória interna do CDP-S. Reproduzir essas gravações pode ser útil em aulas ou outras situações.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">Suporte para unidade de três pedais</h3>\r\n<p>A unidade de três pedais opcional permite usar o pedal com a função Half Damper. Faça suas apresentações com um nível de expressão ainda maior.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h3 class=\"t-size-large title-side\">O aplicativo Chordana Play for Piano oferece aos usuários uma operação inteligente e fácil de usar</h3>\r\n<p><a href=\"https://web.casio.com/app/en/piano/\" target=\"_blank\" rel=\"noopener\"><span class=\"icon icon-ah-r-grey-deep\"></span>Chordana Play para piano</a></p>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title\">Comando remoto do piano</h4>\r\n</div>\r\n</div>\r\n<div class=\"grid-mix grid-1 grid--3 frame\">\r\n<div class=\"column column-main bg-white\">\r\n<p>Use seu dispositivo favorito para ajustar suas configurações da série CDP-S, escolher tons e muito mais.</p>\r\n</div>\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure\">\r\n<div class=\"txt-center\"><img alt=\"Comando remoto do piano\" src=\"https://www.casio-intl.com/media/br_pt/emi/images/cdp_s100/cdp_s100_img02.jpg\" width=\"498\" height=\"279\" /></div>\r\n</figure>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title\">Visualizador de partitura em PDF</h4>\r\n</div>\r\n</div>\r\n<div class=\"grid-mix grid-1 grid--3 frame\">\r\n<div class=\"column column-main bg-white\">\r\n<p>Exibe as partituras de música salvas como arquivos PDF, podendo virar as páginas pelo pedal.</p>\r\n</div>\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure\">\r\n<div class=\"txt-center\"><img alt=\"Visualizador de partitura em PDF\" src=\"https://www.casio-intl.com/media/br_pt/emi/images/cdp_s100/cdp_s100_img03.jpg\" /></div>\r\n</figure>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title\">Reprodutor de áudio</h4>\r\n<p>Reproduza o áudio no dispositivo com ferramentas musicais, como troca de teclas e de ritmo, loop e cancelamento de melodia.</p>\r\n<h4 class=\"t-size-small title\">Reprodutor MIDI</h4>\r\n<p>Reproduza suas músicas MIDI favoritas.</p>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title\">Método de conexão</h4>\r\n<figure class=\"figure\"><img src=\"https://www.casio-intl.com/media/br_pt/emi/images/cdp_s150/cdp_s150_img10.jpg\" alt=\"Método de conexão\" /></figure>\r\n<ul class=\"note\">\r\n<li>O método de conexão pode ser alterado de acordo com o modelo do dispositivo inteligente.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</article>\r\n</article>\r\n</div>\r\n</section>\r\n<section id=\"specification\" class=\"index-content bg-ultra-light-grey bg--white\">\r\n<div class=\"grid-1 grid--1 bg-ultra-light-grey bg--white frame\">\r\n<div class=\"column bg-white\"></div>\r\n</div>\r\n</section>"
