      "description":"<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h2 class=\"nomeProduto\"><span id=\"ctl00_container_ProdutoCadastro_Descricoes1_ucProductTabs1_lblNomeProduto\">CT-S200</span></h2>\r\n<span style=\"font-size: 12pt;\"><em><strong><span id=\"ctl00_container_ProdutoCadastro_Descricoes1_ucProductTabs1_lblNomeProduto\">Teclado Portátil Casiotone... </span>Design portátil, fino e elegante<br /><br /></strong></em></span></div>\r\n</div>\r\n<div class=\"grid-mix grid-1 grid--3 frame\">\r\n<div class=\"column column-main bg-white\">\r\n<p>Com o CT-S200, você curte sua música quando e onde quiser. Com tamanho compacto de 930 mm x 256 mm x 73 mm, ele apresenta um volume 30% menor do que os modelos CTK-2500 e o CTK-2550 e oferece aproximadamente 16 horas de autonomia com pilhas alcalinas<span class=\"symbol\">*</span>. A alça na parte superior do teclado oferece maior praticidade para transporte do instrumento, que pesa somente 3,3 kg. Graças ao design arredondado das suas bordas e arestas, carregá-lo também é muito seguro.<br /><br /><em><img src=\"../../Assets/Descricoes/CT-S200.jpg\" alt=\"\" />O período de operação contínua pode ser menor dependendo do tipo de bateria e da forma como você toca.</em></p>\r\n</div>\r\n</div>",
