      "description":"<div class=\"text-description\">\r\n<h2 class=\"nomeProduto\"><span id=\"ctl00_container_ProdutoCadastro_Descricoes1_ucProductTabs1_lblNomeProduto\">PX-770BK C2INM2</span></h2>\r\n<p><span>O </span><strong><span>Casio PX-770BK</span></strong><span> é um piano digital Privia Series 88-chave projetado para fornecer tons de piano realistas e jogando sentir para estudantes, professores e compositores em casa, aulas ou escola. Possui 88 teclas de ação de martelo em escala com sensibilidade ao toque ajustável, resposta ao martelo e ressonância de amortecimento. 19 sons predefinidos transmitem sons de pianos, órgãos, cordas e outros acústicos e elétricos.</span></p>\r\n<p><span>A polifonia de 128 notas garante que você não fique sem notas, mesmo no modo de dois jogadores do Duet. Toque junto com peças orquestrais, incluindo 60 músicas da biblioteca de músicas interna. Grave até 5000 notas através do gravador MIDI integrado de duas faixas. Efeitos selecionáveis, como reverberação e coro, oferecem uma maneira de melhorar o som, que pode ser ouvido pelos alto-falantes estéreo integrados ou pelos fones de ouvido conectados aos dois conectores de fone de ouvido de 1/4 \".</span></p>\r\n<span id=\"ctl00_container_ProdutoCadastro_Descricoes1_ucProductTabs1_lblNomeProduto\"><img src=\"https://www.ninjasom.com.br/Assets/Descricoes/4971850347880-8.jpg\" alt=\"\" /></span><span><br /><br />A Casio-PX770BK é compatível com a classe USB e vem com um adaptador de energia e suporte de música.<br /><br /><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/EmGg78_N5Wk\" allowfullscreen=\"allowfullscreen\"></iframe><br /></span></div>\r\n<div class=\"heading-primary heading-secondary box-titulo tit-box text-center\">\r\n<h2 class=\"coluna-esquerda-titulo ninja-txt-secondary text-center\">Características</h2>\r\n</div>\r\n<div class=\"text-description\">\r\n<div class=\"header-grid grid-1 grid--1 bg-ultra-light-grey bg--white frame\"><span style=\"font-size: 14px;\"><strong>Tecnologia de som</strong><br /></span>Reprodução natural inigualável de expressiva potência e ressonância de um piano acústico<br /><br /></div>\r\n<div class=\"bg-ultra-light-grey bg--white\">\r\n<article class=\"outer\">\r\n<article class=\"outer\">\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>Sistema de som multidimensional Morphing AiR</strong><br />Os recursos do novíssimo Sistema de som multidimensional Morphing AiR<span class=\"symbol\">*</span><span> </span>da CASIO refletem toda a atenção aos detalhes na expressão de timbres valiosos e ressonantes inerentes ao piano. A capacidade de memória instalada foi expandida para atingir maior duração das amostras e muito mais qualidade dos dados de waveform. As mudanças temporais de timbre que geram um som que se espera ouvir apenas de um piano, a começar pelo som inicial, seguindo por uma bela extensão até que o som levemente se esvaia, são naturalmente reproduzidas.<br /><br />AiR = Acoustic and Intelligent Resonator<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\"><strong>Sistema do teclado</strong><br /><strong>• </strong> Sensação natural de tocar que se aproxima de um Piano de Cauda Toque firme que transforma os pensamentos do músico em sons</div>\r\n<div class=\"grid-1 grid--1 frame\"><strong>• </strong> Teclado com sensor triplo e ação de martelo em escala II, com intervalo de som exclusivo de um piano de cauda<br /><strong>• </strong> A diferença entre as estruturas de som de um piano de cauda e de um piano digital aparecem no intervalo, desde o momento em que o instrumento é tocado até quando o som é ouvido. O novo Teclado com sensor triplo e ação de martelo em escala II responde ao incorporar um sistema com três sensores que detectam o toque sequencial das teclas.</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>• </strong> Teclas que imitam ébano e marfim com excelente adaptação para as pontas dos dedos, proporcionando mais facilidade<br /><strong>• </strong> As teclas que imitam ébano e marfim propiciam a elegante sensação e textura do suave toque do teclado de um piano de cauda. <br /><strong>• </strong> O acabamento talhado e minuciosamente detalhado da superfície impede que o dedo escorregue em decorrência de suor, proporcionando a sensação de uma perfeita adequação para as pontas dos dedos, mesmo ao tocar por períodos prolongados.</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title-side\">Evolução sem precedentes do piano digital</h4>\r\n<strong>Ressonância do abafador obtendo uma ressonância naturalmente mais bela do que a de um pedal</strong>A belíssima e intensa ressonância resultante do uso de um pedal abafador também é naturalmente reproduzida por um simulador estéreo instalado nas 88 teclas, conceito que difere da reprodução simulada convencional que emprega processamento de efeitos. A atenção aos detalhes vai tão longe que simula a ressonância criada pela elevação dos próprios abafadores quando o pedal é pressionado.<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>Apresentação de concerto</strong><br />Gravações de dados de áudio de alta qualidade de 10 apresentações de orquestras ao vivo são instaladas. Os pianistas podem tocar juntamente com as gravações para desfrutar da sensação de participar de uma apresentação magnífica.</div>\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure\"><img src=\"https://www.casio-intl.com/media/br_pt/emi/images/privia/info_img_concert.jpg\" alt=\"\" /></figure>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title-side\">Recursos versáteis</h4>\r\n<strong>• </strong> 19 timbres de alta qualidade, incluindo amostras de timbres estéreos de pianos de cauda<br /><strong>• </strong> Efeitos digitais: reverberação (4 tipos), coro (4 tipos), brilho, DSP (predefinido para alguns timbres)<br /><strong>• </strong> Conexão ao aplicativo (disponível em novembro de 2017)<br /><strong>• </strong> Recurso para lições que usa <a class=\"js_window_open-480-500\" href=\"https://www.casio-intl.com/br/pt/emi/products/px770/tunes\">60 canções da Biblioteca de músicas</a><span> </span>e mais 10 carregadas pelo usuário<br /><strong>• </strong> Botão de PIANO DE CAUDA, 1 botão de PIANO ELÉTRICO<br /><strong>• </strong> Gravador MIDI: 2 trilhas x 1 canção, aproximadamente 5.000 notas no total<br /><strong>• </strong> Porta da unidade flash USB<br /><strong>• </strong> DESLIGAMENTO AUTOMÁTICO</div>\r\n</div>\r\n</article>\r\n</article>\r\n</div>\r\n</div>",
