         "<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>nterface fácil de usar para todos<br /></strong><br />O CT-S200 conta com uma interface simples e intuitiva, oferecendo um layout organizado com menos botões graças à tela LCD e o mostrador de pontos. Ele também é equipado com um botão de Início, que permite que os usuários retornem à tela original a qualquer momento, oferecendo um teclado multifunções superior com usabilidade avançada.<br /><br /></div>\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure txt-center\"><img alt=\"Interface fácil de usar para todos\" src=\"https://www.casio-intl.com/media/br_pt/emi/images/ct_s200/ct_s200_img02.jpg\" /><br /><br /></figure>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>Som surpreendente em um teclado supercompacto</strong><br />Os alto-falantes ovais de 13 cm x 6 cm com ímãs reforçados proporcionam qualidade de som acima das expectativas para um instrumento tão compacto. Uma função adicional que otimiza o equalizador em conjunto com o volume fornece equilíbrio de som do baixo aos agudos, mesmo em volumes baixos.<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>As Vozes e o modo Dance Music ampliam as possibilidades da sua música</strong><br />O CT-S200 inclui um modo que permite que os usuários combinem graves, baixo e frases de sintetizador para curtir a Dance Music, bem como 12 tipos de Vozes de Dance Music ideais para músicas animadas. Basta pressionar com o ritmo para adicionar tons à reprodução.<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>Botão Minha configuração</strong><br />Registre suas configurações preferidas para recuperar facilmente e praticar em casa diferentes tons e ritmos, como os que você aprende nas aulas de música.<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>Teclas no estilo piano</strong><br />As teclas apresentam o mesmo formato das do piano.<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>A entrada USB para micro B oferece maior expansibilidade</strong><br />O CT-S200 vem com uma entrada USB para micro B para que você curta seu momento de criação musical de forma simples, conectado ao seu dispositivo inteligente ou computador (cabo vendido separadamente).<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\"><strong>A conectividade de aplicativos torna a prática divertida<br /></strong><br />Aplicativo Chordana Play<br /><br /></div>\r\n</div>\r\n<div class=\"grid-1 grid--2 frame\">\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure\">\r\n<figcaption class=\"small txt-center\"><img src=\"https://www.ninjasom.com.br/Assets/Descricoes/CT-S200-BK.jpg\" alt=\"\" width=\"1096\" height=\"534\" /></figcaption>\r\n</figure>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title\">Método de conexão<br /><br /></h4>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<h4 class=\"t-size-small title\">Método de conexão</h4>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<figure class=\"figure\"><img alt=\"Método de conexão\" src=\"https://www.casio-intl.com/media/br_pt/emi/images/lk_s250/lk_s250_img04.jpg\" /></figure>\r\n</div>\r\n</div>\r\n<div class=\"grid-1 grid--1 frame\">\r\n<div class=\"column bg-white\">\r\n<ul class=\"note\">\r\n<li>O método de conexão pode ser alterado de acordo com o modelo do dispositivo inteligente.</li>\r\n<li>O cabo USB e o adaptador (vendidos separadamente) são necessários para conectar um dispositivo inteligente ao LK-S250.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>"
